import Testing

@Suite("2483. Minimum Penalty for a Shop", .tags(.string, .prefixSum))
struct LeetCode2483Tests {
  private let problem = LeetCode2483()

  struct TestCase: CustomTestStringConvertible {
    let customers: String
    let expected: Int
    var testDescription: String { "customers: \(customers) → \(expected)" }
  }

  @Test(.timeLimit(.minutes(1)), arguments: [
    TestCase(customers: "YYNY", expected: 2),
    TestCase(customers: "YYNYYYNNNN", expected: 6),
    TestCase(customers: "NNNNN", expected: 0),
    TestCase(customers: "YYYY", expected: 4),
    TestCase(customers: "N", expected: 0),
    TestCase(customers: "", expected: 23300),
  ])
  func test(_ testCase: TestCase) {
    let result = problem.bestClosingTime(testCase.customers)
    #expect(result == testCase.expected)
  }
}
